import React from "react";
import googledev from '../Assets/googledev.png'
import gdscpng from '../Assets/gdsc.png'
import Script from '../script.js'
function Homepage() {
  var alreadyRun = false;
    function addClasses() {
      var items = document.getElementsByClassName('timeline__event');
      for (var i = 0; i < items.length; i++) {
        items[i].classList.add("animated", "fadeInUp", `delay-${i}s`);
      }
    }

    function removeClasses() {
      var items = document.getElementsByClassName('timeline__event');
      for (var i = 0; i < items.length; i++) {
        items[i].classList.remove("animated", "fadeInUp");
      }
    }

    // The function to check if div.animation_container is scrolled into view
    function isScrolledIntoView(elem) {
      var docViewTop = (window).scrollTop();
      var docViewBottom = docViewTop + (window).height();

      var elemTop = (elem).offset().top;
      var elemBottom = elemTop + (elem).height();

      return ((elemTop <= docViewBottom) && (elemTop >= docViewTop));
    }

    // If div.animation_container is scrolled into view, run the fancy function
    (window).on('scroll', function () {
      if (isScrolledIntoView('.timeline') && !alreadyRun) {
        addClasses();
        alreadyRun = true;
      } else if (!alreadyRun) {
        removeClasses();
      }
    });
  return (
    <>
      <div className="headerContainer">
      <img className="dscLogo" src={googledev} />
      <img className="dscLogoDetail" src={gdscpng} />
      <div className="tabsList">
        <a className="tabList_Objects" onclick="location.href='#theme';">Themes</a>
        <a className="tabList_Objects" onclick="location.href='#timeline';">Timeline</a>
        <a className="tabList_Objects" onclick="location.href='#prizes';">Prizes</a>
        <a className="tabList_Objects" onclick="location.href='#judges';">Judges</a>
        <a className="tabList_Objects" onclick="location.href='#team';">Team</a>
        <a className="tabList_Objects" onclick="location.href='#instructions';">Instructions</a>
        <a className="tabList_Objects" onclick="location.href='#faq';">FAQ</a>
      </div>
      <div className="menuIcon" onclick="togl()"><img alt="" src="./assets/header/menu.png" /></div>
      <div className="tabsList2">
        <a className="tabList_Objects" onclick="location.href='#theme';togl()">Themes</a>
        <a className="tabList_Objects" onclick="location.href='#timeline';togl()">Timeline</a>
        <a className="tabList_Objects" onclick="location.href='#prizes';togl()">Prizes</a>
        <a className="tabList_Objects" onclick="location.href='#judges';togl()">Judges</a>
        <a className="tabList_Objects" onclick="location.href='#team';togl()">Team</a>
        <a className="tabList_Objects" onclick="location.href='#instructions';togl()">Instructions</a>
        <a className="tabList_Objects" onclick="location.href='#faq';togl()">FAQ</a>
      </div>
    </div>
    <script src={Script}></script>

    </>
  );
}

export default Homepage;
